const CartDetail = () => {
    return (
        <>
            <div
                style={{
                    border: '1px solid white',
                    paddingLeft: '20px',
                    paddingRight: '20px',
                    backgroundColor: 'white',
                }}
            >
                <div style={{ height: '60px', paddingTop: '15px' }}>
                    Flipkart Count
                </div>

                <div
                    style={{
                        backgroundColor: 'whitesmoke',
                        height: '10px',
                        marginLeft: '-21px',
                        marginRight: '-21px',
                    }}
                ></div>

                <div style={{ height: '60px', paddingTop: '15px' }}>
                    Deliver to:Gurugaon - 122004
                </div>

                <div
                    style={{
                        backgroundColor: 'whitesmoke',
                        height: '10px',
                        marginLeft: '-21px',
                        marginRight: '-21px',
                    }}
                ></div>

                <div style={{ height: '60px', paddingTop: '15px' }}>
                    Flipkart Count
                </div>
            </div>
        </>
    );
};

export default CartDetail;
